INSERT INTO catalog_pages VALUES (12, 2, 'default_3x3', 'credit_furni', 'Cambio de divisas', 1, 146, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_bank_headline1', 'catalog_bank_teaser', 'Habbo Exchange es el lugar donde puedes convertir tus créditos en una moneda intercambiable. Luego puedes usar esta moneda para intercambiar muebles o simplemente mostrar tu riqueza en tu habitación.', '', '');
INSERT INTO catalog_pages VALUES (13, 603, 'spaces_new', 'spaces', 'Suelo', 1, 225, 1, 0, 2, '1', '1', '0', '0', NULL, '', '', 'look_feel_text', '', 'Pisos, papeles pintados, paisajes: Obtén una combinación fantástica para tu habitación. Usa nuestra vista previa del espacio virtual abajo para probar combinaciones antes de comprar. Selecciona el diseño y el color deseado y haz clic en comprar.', '', '');
INSERT INTO catalog_pages VALUES (14, 1411, 'default_3x3', 'limited_rares', 'Rarezas', 1, 145, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'limited_header', 'catalog_limited_teaser_en', '¡Estos solo están disponibles mientras dure su existencia!', '', '');
INSERT INTO catalog_pages VALUES (15, 8, 'club_gift', 'club_gifts', 'Regalos Club', 1, 172, 1, 0, 3, '0', '0', '0', '0', '', '', '', '', '', 'Actualmente no está codificado en Morningstar.', '', '');
INSERT INTO catalog_pages VALUES (16, 603, 'default_3x3', 'lighting', 'Iluminación', 1, 115, 1, 0, 1, '1', '1', '0', '0', NULL, NULL, 'Haz clic en un artículo para ver detalles.', 'catalog_dimmers_header1_en', 'catalog_dimmer_teaser_en', 'Mira las luces de ambiente. Usa estos artículos para atenuar las luces en tus habitaciones. Prueba diferentes configuraciones de luz con diferentes fondos para ver lo que obtienes. ¡Habla con estilo sobre iluminación!', '', '');
INSERT INTO catalog_pages VALUES (17, 568, 'default_3x3', 'mode', 'Modo', 1, 39, 1, 0, 11, '1', '1', '0', '0', '', '', '', 'catalog_mode_headline1', 'catalog_mode_teaser1', 'Funcionalidad moderna combinada con elegante tapicería de diseñador. El Habbo que elige estos muebles es un gato urbano: astuto, audaz y un poco intocable.', '', '');
INSERT INTO catalog_pages VALUES (18, 568, 'default_3x3', 'lodge', 'Rural', 1, 37, 1, 0, 10, '1', '1', '0', '0', '', '', '', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', 'Para el glorioso efecto de cabaña de esquí con chimenea abierta y whisky al costado. Esta colección es para aquellos que aprecian la verdadera belleza de la madera maciza.', '', '');
INSERT INTO catalog_pages VALUES (19, 568, 'default_3x3_color_grouping', 'colourable_plasto', 'Plástico coloreado', 1, 46, 1, 0, 9, '1', '1', '0', '0', '', '', '', 'plastic', 'plastic_pasic_promo_1', '', '', '');
INSERT INTO catalog_pages VALUES (20, 602, 'default_3x3', 'vegetation', 'Plantas', 1, 3, 1, 0, 3, '1', '1', '0', '0', '', '', '', 'catalog_plants_headline1', 'catalog_plants_teaser1', '¡Cada habitación necesita una planta! No solo traen un pedazo del exterior al interior, ¡sino que también mejoran la calidad del aire! Y, ¿qué hay mejor para un amigo que una hermosa rosa o un elegante árbol frutal...', '', '');
INSERT INTO `catalog_pages` VALUES (21, 603, 'default_3x3', 'walls', 'Murallas', 1, 122, 1, 0, 7, '1', '1', '0', '0', '', '', '', 'catalog_walls_header_dyn', 'catalog_walls_teaser2_001', '¡Trae la naturaleza a través de ventanas y letreros. Transforma tu entorno: ¡tus paredes nunca volverán a verse desnudas!', '', '');
INSERT INTO `catalog_pages` VALUES (22, 568, 'default_3x3', 'accessories', 'Accesorios', 1, 11, 1, 0, 18, '1', '1', '0', '0', '', '', '', 'catalog_extra_headline1', 'catalog_extra_teaser1', '¡No importa cómo coloques tus muebles esenciales, el toque final es lo que cuenta!', '', '');
INSERT INTO `catalog_pages` VALUES (24, 209, 'default_3x3', 'base', 'Base', 1, 179, 1, 0, 8, '1', '1', '0', '0', '', '', '', 'catalog_header_base', 'base_rentable_teaser', 'Esta colorida selección de muebles ofrece todo lo que necesitas para diseñar tu espacio y construir grandes áreas.', '', '');
INSERT INTO `catalog_pages` VALUES (25, 604, 'badge_display', 'badge_display', 'Comprar Badges', 1, 224, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_header_badgedisplay', 'badgedisplay_promo2', 'Has trabajado duro para conseguir tus medallas, ¿verdad? ¡Ahora es el momento de mostrarlas, consigue una vitrina y elige tu medalla favorita para exhibir!', '', '');
INSERT INTO `catalog_pages` VALUES (26, 2, 'roomads', 'room_ad', 'Información', 1, 42, 1, 0, 2, '1', '0', '0', '0', '', '', '', 'events_header', '', '', '', '');
INSERT INTO `catalog_pages` VALUES (27, 568, 'default_3x3', 'iced', 'Enfriado por hielo', 1, 72, 1, 0, 8, '1', '1', '0', '0', '', '', '', 'catalog_iced_headline1', 'catalog_iced_teaser1', 'Es tan elegante que dice todo y nada al mismo tiempo. Es un lienzo en blanco, ¡deja que tu imaginación vuele!', '', '');
INSERT INTO `catalog_pages` VALUES (28, 209, 'default_3x3', 'alhambra', 'Alhambra', 1, 12, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'alhambra_header', 'alhambra_teaser', 'Para las frías noches árabes y los calurosos días árabes, necesitas un palacio... ¡Y tenemos justo lo que necesitas! ¡El estampado floral verde debería cubrirlo bien!', '', '');
INSERT INTO `catalog_pages` VALUES (29, 209, 'default_3x3', 'glass', 'Gafas', 1, 29, 1, 0, 12, '1', '1', '0', '0', '', '', '', 'catalog_glass_headline1', 'catalog_glass_teaser1', 'Realmente puedes abrir un espacio con estos muebles de vidrio elegantes, ¡solo no entres en él!', '', '');
INSERT INTO `catalog_pages` VALUES (30, 209, 'default_3x3', 'gothic', 'Gótico', 1, 30, 1, 0, 42, '1', '1', '0', '0', NULL, '', '', 'catalog_gothic_headline1', 'catalog_gothic_teaser1', 'Cuando a medianoche suenen las campanas de la iglesia, camina por tu pasillo iluminado por velas, lánzate a tu trono medieval y pinta tus uñas de negro. Eso fue lo que imaginamos cuando pedimos esta serie de muebles.', '', '');
INSERT INTO `catalog_pages` VALUES (31, 209, 'default_3x3', 'japan', 'Japón', 1, 36, 1, 0, 59, '1', '1', '0', '0', '', '', '', 'catalog_jap_headline1', 'catalog_jap_teaser3_en', '¡Tenemos Sushi, Tatami y Katanas! No tengo idea de cuál es la diferencia, ¡pero sé que todo es japonés! ¡Cumple tus fantasías y compra algo hoy mismo!', '', '');
INSERT INTO `catalog_pages` VALUES (32, 209, 'default_3x3', 'lost_tribe', 'Tribu perdida', 1, 38, 1, 0, 121, '1', '1', '0', '0', '', '', '', 'losttribe', 'LT_teaser_en', '¡Comienza tu propio pueblo tribal con nuestros muebles antiguos, todos tallados en piedra robusta! NOTA: La lava está caliente, pide ayuda a un adulto.', '', '');
INSERT INTO `catalog_pages` VALUES (33, 209, 'default_3x3', 'neon', 'Neón', 1, 41, 1, 0, 77, '1', '1', '0', '0', '', '', '', 'catalog_neon_header1_en', 'catalog_neon_teaser1_en', '¡Los amantes de las fiestas están encantados! Coloca los cimientos y enciende los láseres con la serie de muebles Neon, ¡todo lo que necesitas para iniciar la fiesta!', '', '');
INSERT INTO `catalog_pages` VALUES (34, 209, 'default_3x3', 'relax', 'Relájate', 1, 49, 1, 0, 27, '1', '1', '0', '0', '', "", '', 'rela_header_en', 'rela_teaser_en', 'Relájate después de un día lleno de eventos en la sala de bienvenida. Enciende algunas velas y disfruta de una buena lectura en una silla de mimbre. ¡Entendemos las necesidades de alguien con un estilo de vida agitado!', '', '');
INSERT INTO `catalog_pages` VALUES (36, 209, 'default_3x3', 'scifi', 'Ciencia Ficción', 1, 53, 1, 0, 99, '1', '1', '0', '0', '', '', '', 'sf_header_en', 'sf_teaser_en', 'Convención de ciencia ficción, espacio, luna, ¡tenemos todo lo que necesitas para crear tu propio espacio místico, no terrenal!', '', '');
INSERT INTO `catalog_pages` VALUES (38, 219, 'default_3x3', 'freeze!', '¡Congelarse!', 1, 87, 1, 0, 5, '1', '1', '0', '0', NULL, '', '', 'catalog_freeze_en', 'ctlg_teaser_es', '¡Congélate! ... y prueba el último juego para conocer a tus amigos! Forma un equipo y lanza bombas de nieve para congelar a tus rivales. ¡Se podría decir que es genial, está congelado!', '', '');
INSERT INTO `catalog_pages` VALUES (40, 603, 'default_3x3', 'ads_room_backgrounds', 'Fondos', 5, 47, 1, 0, 6, '1', '1', '0', '0', NULL, '', '', '', '', 'Úsalos para colocar imágenes en tu habitación. Los fondos llevan a un enlace cuando haces clic en ellos; los anuncios no.', '', '');
INSERT INTO `catalog_pages` VALUES (41, 387, 'default_3x3', 'theatredome', 'Cúpula del teatro', 1, 927, 1, 0, 25, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'article_habboreport2', 'El Theatredrome es un espacio público muy antiguo y popular. Ha albergado muchas campañas de patrocinadores que pagan.', '', '');
INSERT INTO `catalog_pages` VALUES (42, 568, 'default_3x3', 'rollers', 'Rodillos', 1, 222, 1, 0, 6, '1', '1', '0', '0', NULL, '', '', 'catalog_roller_headline1', 'catalog_teaser_rollers_en', 'Deja volar tu imaginación. Estas piezas son adecuadas tanto para negocios como para entretenimiento... Rodillos de Habbo para juegos y colas. Ahora disponibles en paquetes múltiples.', '', '');
INSERT INTO `catalog_pages` VALUES (44, 209, 'default_3x3', 'twilight', 'Crepúsculo', 1, 52, 1, 0, 116, '1', '1', '0', '0', NULL, '', '', 'catalog_twilight_header_en', 'ctlg_pic_ads_twi_mist', 'Nunca he leído el libro, pero sé que tiene vampiros que juegan baloncesto, y un rompecorazones llamado Edward Cullen. ¡Pero los muebles se ven bien!', '', '');
INSERT INTO `catalog_pages` VALUES (45, 219, 'default_3x3', 'battle_banzai', 'Battle Banzai', 1, 78, 1, 0, 3, '1', '1', '0', '0', NULL, '', '', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', 'Más grande, mejor, con más saltos: ¡es Battle Banzai! Ahora estableces las reglas de tu propio juego, en tu propia habitación. ¡Tienes el poder de Banzai!', '', '');
INSERT INTO `catalog_pages` VALUES (46, 253, 'default_3x3', 'trax', 'Trax', 1, 257, 1, 0, 21, '1', '1', '0', '0', '', 'Solo para decoración. No funcionan.', '', 'hotelhits_catalog_header', 'hotelhits_teaser', 'Trax son discos de música de Habbo con muchas melodías que puedes reproducir en una máquina automática Trax en tu habitación. Luego de la transición de Shockwave a Flash, el sistema Trax no fue restaurado hasta abril de 2011, cuando solo se republicaron las juke boxes y los CDs antiguos vendidos por Habbo.', '', '');
INSERT INTO `catalog_pages` VALUES (50, 568, 'default_3x3', 'automoviles', 'Automóviles', 1, 5, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'tienda-pixel', 'pixel3', '', '', '');
INSERT INTO `catalog_pages` VALUES (51, 209, 'default_3x3', 'organo', 'Órgano', 1, 235, 1, 0, 81, '1', '1', '0', '0', '', '', '', 'organo_cata_header', 'organo_teaser', 'La última serie de Ann Summers, la línea Órgano. Hecha de un plástico suave que se limpia con un paño, es perfecta para tres, cuatro o cinco!', '', '');
INSERT INTO `catalog_pages` VALUES (52, 234, 'default_3x3', 'pet_food', 'Alimentos para animales', 1, 201, 1, 0, 7, '1', '1', '0', '0', '', '', '', 'catalog_header_petfood', 'ctlg_pet_teaser1', 'Halten Sie Ihr Haustier glücklich und gesund. Füttern Sie es und vergessen Sie nicht die Bewegung!', '', '');
INSERT INTO `catalog_pages` VALUES (53, 209, 'default_3x3', 'runway', 'Ruta de despegue', 1, 6453, 1, 0, 105, '1', '1', '0', '0', '', '', '', 'runway_header_en', 'runway_teaser_en', 'Peppen Sie Ihren Salon, Friseur oder Ihre Boutique mit unserem eleganten und praktischen Sortiment auf! Von Nähmaschinen bis hin zu bequemen Sitzen haben wir die perfekte Option für Sie.', '', '');
INSERT INTO `catalog_pages` VALUES (54, 209, 'default_3x3', 'prison', 'Prisión', 1, 240, 1, 0, 41, '1', '1', '0', '0', '', '', '', 'prisonheader', 'prisonteaser', 'Hey, es läuft weg! Nur ein Scherz, niemand wird aus diesen Hochsicherheitszellen herauskommen!', '', '');
INSERT INTO `catalog_pages` VALUES (55, 209, 'default_3x3', 'tv_studio', 'Estudio de televisión', 1, 136, 1, 0, 31, '1', '1', '0', '0', '', '', '', 'header_studio', 'teaser_studio', 'Das Studio-Sortiment ermöglicht es Ihnen, Ihr eigener Musikproduzent zu sein!', '', '');
INSERT INTO `catalog_pages` VALUES (56, 209, 'default_3x3', 'cubie', 'Cubie', 1, 100, 1, 0, 17, '1', '1', '0', '0', '', '', '', 'catalog_cubie_header_en', 'catalog_cubie_teaser', 'Es ist stilvoll, es ist modern, es ist so cool, dass es kaum alleine stehen kann... Wir stellen vor: die Cubie Furni-Serie! Verleihen Sie Ihrer Junggesellen- oder Junggesellinnenwohnung eine wohnliche Note mit einem raffinierten Twist.', '', '');
INSERT INTO `catalog_pages` VALUES (57, 209, 'default_3x3', 'waasa', 'Waasa', 1, 103, 1, 0, 123, '1', '1', '0', '0', '', '', '', 'waasa_catalogue_header', 'waasa_teaser', 'Waasa ist das perfekte Möbelstück für einen ruhigen und entspannten Raum. Besonders gut für Studenten mit kleinem Budget!', '', '');
INSERT INTO `catalog_pages` VALUES (58, 209, 'default_3x3', 'american_idol', 'American Idol', 1, 52, 1, 0, 3, '1', '1', '0', '0', '', '', '', 'catalog_header_AI1_en', 'catalog_teaser_idol', 'Veranstalten Sie Ihre eigene American Idol Show mit dieser Möbelreplik! Alles, was fehlt, ist eine Ähnlichkeit mit Randy Jackson!', '', '');
INSERT INTO `catalog_pages` VALUES (59, 209, 'default_3x3', 'kitchen', 'Cocina', 1, 217, 1, 0, 66, '1', '1', '0', '0', '', '', '', 'catalog_header_kitchen2015', 'teaser_kitchen2015', 'Lust auf ein Habbo-Restaurant? Oder lieben Sie es einfach, Habbos stilvoll zu bedienen? Mit dieser Linie von Furnis können Sie WIRKLICH anfangen zu kochen!', '', '');
INSERT INTO `catalog_pages` VALUES (62, 209, 'default_3x3', 'mystics', 'Místico', 1, 185, 1, 0, 76, '1', '1', '0', '0', '', '', '', 'header_mystics', 'teaser_mystics', 'Ein mystischer Kristall ist außerhalb der Hotelgrenzen abgestürzt und verwandelt das Hotel in eine infizierte Wüste. Wirst du für immer für die Seite kämpfen? Oder wirst du auf der Seite des Bösen kämpfen und helfen, dass sich die Infektion ausbreitet?', '', '');
INSERT INTO `catalog_pages` VALUES (63, 218, 'default_3x3', 'wired_triggers', 'Detonador', 1, 81, 1, 0, 2, '1', '1', '0', '0', NULL, '', 'Click to see how each Trigger works.', 'catalog_wired_header2_en', 'ctlg_pic_wired_triggers', 'Mit den Ursachen können Sie definieren, was passieren muss, damit ein Effekt eintritt. Um eine Ursache zu planen, platzieren Sie sie in einem Raum, doppelklicken Sie darauf, und konfigurieren Sie sie. Sie müssen einen Effekt mit dem Trigger stapeln, damit er funktioniert.', '', '');
INSERT INTO `catalog_pages` VALUES (64, 218, 'default_3x3', 'wired_effects', 'Efectos', 1, 82, 1, 0, 3, '1', '1', '0', '0', NULL, '', 'Click on an item to see what the Effect does!', 'catalog_wired_header3_en', 'ctlg_pic_wired_effects', 'Effekte sind das, was passiert, nachdem Sie einen Auslöser ausgelöst haben. Um einen Effekt zu programmieren, platzieren Sie ihn in einem Raum, doppelklicken Sie darauf und konfigurieren Sie ihn. Sie müssen immer einen Trigger mit dem Effekt stapeln, damit es funktioniert.', '', '');
INSERT INTO `catalog_pages` VALUES (65, 218, 'default_3x3', 'wired_conditions', 'Condiciones', 1, 83, 1, 0, 4, '1', '1', '0', '0', NULL, '', 'Click on an item to see what the Condition does!', 'catalog_wired_header4_en', 'ctlg_pic_wired_conditions', 'Bedingungen sind bestimmte Dinge, die getan werden müssen, bevor ein Auslöser funktioniert. Wenn Sie eine Bedingung verwenden möchten, müssen Sie sie mit einem Trigger und einem Effekt stapeln.', '', '');
INSERT INTO `catalog_pages` VALUES (66, 209, 'default_3x3', 'caballetes', 'Callabetes', 1, 179, 1, 0, 14, '1', '1', '0', '0', '', '', '', 'StrayPixelsLogo', 'catalog_pxl_teaser2_nl', '', '', '');
INSERT INTO `catalog_pages` VALUES (67, 209, 'default_3x3', 'mayan', 'Maya', 1, 171, 1, 0, 71, '1', '1', '0', '0', '', '', '', 'mayanheader2', 'mayanteaser', 'Genau das, was Sie brauchen, um zu beweisen, dass Sie die Apokalypse überlebt haben!', '', '');
INSERT INTO `catalog_pages` VALUES (68, 209, 'default_3x3', 'african', 'África', 1, 233, 1, 0, 1, '1', '1', '0', '0', '', '', '', 'african_header', 'african_catateaser', 'Die neue Serie afrikanischer Möbel ist da!', '', '');
INSERT INTO `catalog_pages` VALUES (69, 209, 'default_3x3', 'anna', 'Anna', 1, 104, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'catalog_anna_header', 'catalog_anna_teaser', 'Machen Sie das neue Anna-Sortiment zu Ihrem!', '', '');
INSERT INTO `catalog_pages` VALUES (70, 209, 'default_3x3', 'steampunk', 'Steampunk', 1, 180, 1, 0, 106, '1', '1', '0', '0', '', '', '', 'catalog_header_steampunk', 'catalog_teaser_steampunk', 'Verleihen Sie Ihrer Raumgestaltung Dampfkraft! Diese Steampunk-Linie ist ein kompletter Satz von Baumaterial, um erstaunliche Raumdesigns zu schaffen, die einem alternativen retro-futuristischen Universum ähneln.', '', '');
INSERT INTO `catalog_pages` VALUES (71, 602, 'default_3x3', 'tents', 'Camping', 1, 223, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'catalog_header_tents', 'catalog_teaser_tents', 'Möchten Sie etwas Privatsphäre? Gehen Sie in ein Zelt, um private Gespräche an öffentlichen Orten zu führen. Habbos draußen werden Ihren Chat nicht sehen oder sehen, was drinnen passiert.', '', '');
INSERT INTO `catalog_pages` VALUES (73, 123221222, 'default_3x3', 'calippo', 'Calippo', 10, 927, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'calippo_header_es', '', '', '', '');
INSERT INTO `catalog_pages` VALUES (74, 209, 'default_3x3', 'habbo_stars', 'Estrellas Habbo', 1, 401, 1, 0, 50, '1', '1', '0', '0', '', '', '', 'habbostars1', 'habbostars2', 'Wolltest du schon immer berühmt sein? Ist Singen, Tanzen oder Schauspielen dein Ding? Nun, wir haben die nächstbeste Option, Wulles Stars! Tanzen Sie und bringen Sie Ihren Namen zum Strahlen!', '', '');
INSERT INTO `catalog_pages` VALUES (75, 277, 'pets', 'dogs', 'Perros', 1, 24, 1, 0, 13, '1', '1', '0', '0', 'Name your Dog:', 'Pick a colour:', 'Pick a breed:', 'catalog_pet_headline1', '', 'Nasse Nasen, Pfoten und Wuffs! Du bist dabei, die Welt von Habbo Dogs zu betreten. Ein entzückendes und kuscheliges Fellknäuel erwartet Sie mit einem wackelnden Schwanz.', '', '');
INSERT INTO `catalog_pages` VALUES (76, 277, 'pets', 'cats', 'Gatos', 1, 20, 1, 0, 14, '1', '1', '0', '0', 'Name your Cat:', 'Pick a colour:', 'Pick a breed:', 'catalog_pet_headline1', '', 'Flusen, Schnurrhaare, Miauen und Schnurren! Diese niedlichen kleinen Kreaturen sind großartige Spielkameraden und werden Sie unterhalten.', '', '');
INSERT INTO `catalog_pages` VALUES (77, 277, 'pets', 'crocs', 'Cocodrilos', 1, 22, 1, 0, 15, '1', '1', '0', '0', 'Name your Croc:', 'Pick a colour:', 'Pick a breed:', 'catalog_pet_headline1', '', 'Schuppige Haut, Knurren und Schnappen! Sicherheit für Ihr Zimmer oder verwendet, um Ihre Freunde zu erschrecken - dieses überraschend liebevolle Croc kann Ihnen gehören.', '', '');
INSERT INTO `catalog_pages` VALUES (78, 277, 'pets', 'terriers', 'Terrier', 1, 66, 1, 0, 25, '1', '1', '0', '0', 'Name your Terrier:', 'Pick a colour:', 'Pick a breed:\r\n', 'catalog_pet_headline1', '', 'Der Cairn Terrier ist eine der ältesten Terrierrassen. Aus den schottischen Highlands stammend, wurde es für die Jagd auf Beute unter den Steinhaufen verwendet! Verschiedene Rassen haben unterschiedliche Farben!', '', '');
INSERT INTO `catalog_pages` VALUES (79, 277, 'pets', 'bears', 'Oso', 1, 68, 1, 0, 3, '1', '1', '0', '0', 'Name your Bear:', '', 'Pick a breed:', 'catalog_pet_headline1', '', 'Ein großes Säugetier, das auf den Fußsohlen läuft, mit dickem Fell und einem kurzen Schwanz. Wussten Sie, dass Bären mit Hunden verwandt sind und dass die meisten Arten Allesfresser sind?', '', '');
INSERT INTO `catalog_pages` VALUES (80, 277, 'pets', 'pig', 'Cerdos', 1, 67, 1, 0, 23, '1', '1', '0', '0', 'Name your Pet Pig:', 'Pick a colour:', 'Pick a breed:\r\n', 'catalog_pet_headline1', '', 'Endlich eine Ausrede, um Ihr Zimmer wie einen Schweinestall aussehen zu lassen! Schelmisch und süß, diese kleinen Kerle sind außergewöhnlich. Süß und lustig, ein Haustier wie kein anderes!', '', '');
INSERT INTO `catalog_pages` VALUES (81, 277, 'pets', 'lion', 'Leones', 1, 76, 1, 0, 18, '1', '1', '0', '0', 'Name your pet:', 'Choose a colour:', 'Choose a breed:\r\n', 'catalog_pet_headline1', '', 'Ein ungestümes Raubtier in der Natur, der Löwe wurde gezähmt, um Ihr wilder Freund im Habbo Hotel zu sein.', '', '');
INSERT INTO `catalog_pages` VALUES (82, 277, 'pets', 'rhino', 'rinocerontes', 1, 77, 1, 0, 19, '1', '1', '0', '0', 'Name your pet:', 'Choose a colour:', 'Choose a breed:', 'catalog_pet_headline1', '', 'Das Nashorn ist ein afrikanischer Pflanzenfresser, der über eine Tonne wiegen kann. Es ist stolz und leicht distanziert, aber loyal und lässt nie etwas einer guten Zeit im Weg stehen!', '', '');
INSERT INTO `catalog_pages` VALUES (83, 277, 'pets', 'spider', 'Arañas', 1, 95, 1, 0, 24, '1', '1', '0', '0', '', 'Name your pet:', '', 'catalog_pet_headline1', '', 'Eine der am meisten gefürchteten Kreaturen in der Natur und vielleicht die am meisten missverstandene. Die meisten Spinnen haben scharfe Reißzähne, die Gift in ihre Beute injizieren - aber keine Sorge, diese Spinnen beißen nicht! Vielleicht...', '', '');
INSERT INTO `catalog_pages` VALUES (84, 277, 'pets', 'turtle', 'Tortugas', 1, 126, 1, 0, 22, '1', '1', '0', '0', '', 'Name your Turtle:', '', 'catalog_pet_headline1', '', 'Alles andere als langsam, diese Jungs sind bereit, die Wellen zu reiten und Runden an Ihren Stränden zu schwimmen!', '', '');
INSERT INTO `catalog_pages` VALUES (85, 277, 'pets', 'chick', 'Pollitos', 1, 107, 1, 0, 16, '1', '1', '0', '0', '', 'Name your Dragon:', 'Select your colour/breed:\r\n', 'catalog_pet_headline1', '', '', '', '');
INSERT INTO `catalog_pages` VALUES (86, 277, 'pets', 'frog', 'Ranas', 1, 97, 1, 0, 5, '1', '1', '0', '0', '', 'Name your Frog:', '', 'catalog_pet_headline1', '', 'Niedlich, grün und schleimig! Frösche gibt es in einer Vielzahl von Farben und sind auf der ganzen Welt zu finden. Sie sind großartige Springer und machen großartige Haustiere, sind aber schwerer zu halten als ein Supermodel in einem Tornado.', '', '');
INSERT INTO `catalog_pages` VALUES (87, 277, 'pets', 'dragon', 'Dragones', 1, 109, 1, 0, 4, '1', '1', '0', '0', '', 'Name your Dragon:', '', 'catalog_pet_headline1', '', 'Hüter des Drachen, hütet euch... Ihre Geschichte ist legendär... Mit ihrem feurigen Atem und ihrer schuppigen Haut sind diese Fabelwesen nichts als wild!', '', '');
INSERT INTO `catalog_pages` VALUES (88, 277, 'pets', 'monkey', 'Mono', 1, 166, 1, 0, 1, '1', '1', '0', '0', '', '<p>Name your Monkey:</p>', '', 'catalog_pet_headline1', '', 'Dieser schelmische Affe hat seinen Weg ins Hotel und in unsere Herzen gefunden. Von der geneigten Baskenmütze bis zu seiner Liebe zu Bananenbündeln - dieser Affe wird Ihr Habbo-Leben beleben!', '', '');
INSERT INTO `catalog_pages` VALUES (89, 277, 'pets', 'horse', 'Caballos', 1, 132, 1, 0, 20, '1', '1', '0', '0', '', '<p>Name your Horse:</p>', '', 'catalog_horse_header2_en', '', 'Sie können Ihr Pferd durch das Hotel reiten und seine Körper- und Haarfarbe anpassen.', '', '');
INSERT INTO `catalog_pages` VALUES (90, 277, 'pets', 'bunny', 'Conejito', 1, 148, 1, 0, 8, '1', '1', '0', '0', '', 'Name your Piglet:', 'Select your colour/breed:\r\n', 'babypets_cata_header', '', 'GRUNZEN! Teilweise zu einer guten Rolle im Schlamm, haben diese verspielten Schweinchen ins Hotel getrottet und sind bereit für Spaß!', '', '');
INSERT INTO `catalog_pages` VALUES (91, 277, 'pets', 'bunny_bad', 'Conejo - Malo', 1, 151, 1, 0, 11, '1', '1', '0', '0', '', 'Name Your Horse:', '', 'catalog_horse_header2_en', '', 'Sie können Ihr Pferd rund um das Hotel reiten und auch seine Körper- und Haarfarbe anpassen.', '', '');
INSERT INTO `catalog_pages` VALUES (92, 277, 'pets', 'bunny_bored', 'El conejo... aburrido', 1, 150, 1, 0, 9, '1', '1', '0', '0', '', 'Name your Obbah Wobbah:', 'Select a colour:', 'catalog_pet_headline1', '', 'Diese schelmischen kleinen Haustiere sind den ganzen Weg aus dem tiefen Dschungel von WobbahLand angereist! Bezaubernd wie sie unartig sind, lieben diese kleinen Kerle ein gutes Sing-a-long.', '', '');
INSERT INTO `catalog_pages` VALUES (93, 277, 'pets', 'bunny_manic', 'Conejo - maníaco', 1, 149, 1, 0, 10, '1', '1', '0', '0', '', 'Name your pet:', '', 'catalog_pet_headline1', '', 'Eine der am meisten gefürchteten Kreaturen in der Natur und vielleicht die am meisten missverstandene. Die Mehrheit der Spinnen hat scharfe Reißzähne, die Gift in ihre Beute injizieren - aber keine Sorge, diese Spinnen werden nicht beißen! Vielleicht...', '', '');
