INSERT INTO `catalog_pages` VALUES (203, 3, 'default_3x3', 'dresses', 'Vestidos', 6, 74, 1, 0, 7, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Kleide dich, um mit diesen wunderschönen, fachmännisch gefertigten Kleidern zu beeindrucken! Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
INSERT INTO `catalog_pages` VALUES (204, 3, 'default_3x3', 'shirts', 'Camisetas', 6, 74, 1, 0, 8, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Als etwas intelligentere Option werden unsere Shirts Ihre Freunde begeistern! Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
