INSERT INTO `catalog_pages` VALUES (206, 3, 'default_3x3', 'trousers', 'Pantalones', 6, 74, 1, 0, 10, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Untere Hälfte Kleidung für die etwas kälteren Tage. Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
