INSERT INTO `catalog_pages` VALUES (211, 218, 'default_3x3', 'wired_addons', 'Accesorios inalámbricos', 1, 85, 1, 0, 7, '1', '1', '0', '0', NULL, '<p>¡Usa disparadores, efectos y condiciones para hacer que estos Furni funcionen!</p>', '', 'catalog_wired_header5_en', 'ctlg_pic_wired_support_furniture', 'Verwenden Sie diese einfachen Möbel, um Ihr kabelgebundenes Zimmer aufzupeppen. Dies sind grundlegende Furni, so dass Sie immer noch Ursachen, Auswirkungen und Bedingungen benötigen, damit sie funktionieren.', '', '');
INSERT INTO `catalog_pages` VALUES (212, 209, 'default_3x3', 'gardening', 'Jardín', 1, 157, 1, 0, 39, '1', '1', '0', '0', '', '', '', 'garden_catalog_header', 'garden_catalog_teaser', 'Sei eins mit der Natur!', '', '');
INSERT INTO `catalog_pages` VALUES (214, 209, 'default_3x3', 'stranded_jungle', 'Selva', 1, 59, 1, 0, 24, '1', '1', '0', '0', '', '', '', 'catalog_header_2016jungle', 'junglenewfurni', 'Tauche ein in eine virtuelle Welt voller Überleben, tückischem Gelände und lebensbedrohlichen tropischen Bedingungen ... denn die Stranded Jungle Line ist da!', '', '');
