INSERT INTO `catalog_pages` VALUES (236, 123221222, 'default_3x3', 'virus_2016_fish_tanks', 'Acuarios', 10, 927, 1, 0, 8, '1', '1', '0', '0', '', '', '', 'catalog_rares_headline1_br', 'catalog_limited_teaser_fi', '', '', '');
INSERT INTO `catalog_pages` VALUES (238, 277, 'single_bundle', 'gnome', 'Gnom', 1, 200, 1, 0, 6, '1', '1', '0', '0', '', '', '', 'catalog_header_gnomes', 'catalog_teaser_gnome', 'Gib einem Gnom ein Zuhause. Wenn Sie dies tun, wird es Sie mit viel Spaß belohnen. Beobachten Sie, wie es sitzt. Stehen. Gehen. Es kann sogar den Zustand Ihrer Möbel ändern. Erstaunliche Kreaturen!', '', '');
INSERT INTO `catalog_pages` VALUES (242, 234, 'petcustomization', 'saddles', 'Montañas', 1, 135, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'catalog_saddles_header2_en', 'sadddles', 'Um einen Sattel zu benutzen, stellen Sie ihn in einen Raum, in dem Sie mindestens ein Pferd haben. Doppelklicken Sie auf den Sattel und wählen Sie aus, welches Pferd Sie reiten möchten Nachdem Sie den Sattel platziert haben, können Sie Ihr Pferd reiten, indem Sie darauf klicken und \"Reiten\" auswählen.', '', '');
INSERT INTO `catalog_pages` VALUES (243, 234, 'petcustomization', 'dyes', 'Colorante', 1, 133, 1, 0, 3, '1', '1', '0', '0', '', '', '', 'catalog_horsedyes_header2_en', 'dyes', 'Passen Sie Ihr Pferd mit dieser Auswahl an Haarfarben und Körpertypen an. Jeder Farbstoff kann auch als Möbelstück zu Ihrem Zimmer hinzugefügt werden. Um einen Farbstoff zu verwenden, legen Sie es in Ihr Zimmer, doppelklicken Sie darauf und wählen Sie dann das Pferd aus, das Sie anpassen möchten.', '', '');
INSERT INTO `catalog_pages` VALUES (244, 234, 'petcustomization', 'hair_styles', 'Melenas', 1, 134, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'catalog_horsehairstyles2_header_en', 'hairs', 'Passen Sie Ihr Pferd an und machen Sie es einzigartig mit dieser Auswahl an Frisuren.  Jeder Stil kann auch als Möbelstück zu Ihrem Zimmer hinzugefügt werden. Um eine Frisur zu verwenden, platzieren Sie sie in Ihrem Zimmer, doppelklicken Sie darauf und wählen Sie dann das Pferd aus, das Sie anpassen möchten.', '', '');
INSERT INTO `catalog_pages` VALUES (245, 234, 'default_3x3', 'horse_jump', 'Saltar', 1, 113, 1, 0, 6, '1', '1', '0', '0', '', '', '', 'catalog_header_jumping_en', 'catalog_teaser_horsejump', 'Nehmen Sie Ihr Pferd mit diesen neuen Furni! Baue eine beeindruckende Rennstrecke, um dein Ross und deine Fahrkünste zu testen und deine Freunde herauszufordern!', '', '');
INSERT INTO `catalog_pages` VALUES (246, 4, 'pets3', 'monster_plants', 'Plantas monstruosas', 1, 153, 1, 0, 5, '1', '1', '0', '0', 'Pflege deine Pflanze', '<p>Deine Pflanzen müssen regelmäßig gepflegt werden, sonst sterben sie ab.<br>Um sicherzustellen, dass die Pflanze gesund bleibt, pflege sie etwa alle 30 Stunden.<br>Wenn sie stirbt, kannst du den Wiederbelebungstrank verwenden, um sie wieder zum Leben zu erwecken.<br>Um deine Pflanze zu züchten, musst du warten, bis sie ausgewachsen ist.<br>Wenn du im Menü auf Züchten klickst, wird dir angezeigt, mit welchen anderen Pflanzen im Raum Sie züchtbar ist.</p>', '', 'catalog_header_mopla_01', 'ctlg_monster_note', 'Monsterpflanzen können sicher eine Handvoll sein, diese Seite gibt Ihnen einige zusätzliche Ratschläge zur Aufzucht und Pflege Ihrer Monsterbrut.', '', '');
INSERT INTO `catalog_pages` VALUES (247, 246, 'default_3x3', 'monster_plant_seeds', 'Semillas de plantas monstruosas', 1, 156, 1, 0, 1, '1', '1', '0', '0', '', '', '', 'catalog_header_mnstrSeeds', 'quest_teaser_monsterplants', 'Pflanzen Sie Ihre Samen in Ihrem Zimmer und neigen Sie dazu, sie am Leben und gesund zu halten. Nachdem Ihre Pflanzen gereift sind, können Sie Ihre Pflanzen züchten, um zu versuchen, Nachkommen zu leveln. Pflanzen können sich nur einmal vermehren, ohne den Rebreeding Potion zu verwenden.', '', '');
INSERT INTO `catalog_pages` VALUES (248, 246, 'default_3x3', 'monster_plant_potions', 'Bebidas vegetales monstruosas', 1, 155, 1, 0, 2, '1', '1', '0', '0', NULL, '', '', 'monsterplantsprays_header', 'monsterplantspray_teaser', 'Auf dieser Seite findest du alles, was du brauchst, um sich um deine Pflanzen zu kümmern: Plant Revival für den Fall, dass deine Pflanzen sterben. Lege den Trank in den Raum, doppelklicke ihn und wähle die Pflanze aus, die du wiederbeleben möchtest.', '', '');
INSERT INTO `catalog_pages` VALUES (249, 209, 'default_3x3', 'wedding', 'Boda', 1, 238, 1, 0, 56, '1', '1', '0', '0', '', '', '', 'catalog_header_wedding', 'catalog_teaser_wedding', 'Jetzt können Sie Ihren großen Tag mit unserer wunderbaren Auswahl an Möbeln feiern, die perfekt für eine Hochzeit sind!', '', '');
INSERT INTO `catalog_pages` VALUES (251, 202394511, 'single_bundle', 'cow_box', 'Kühbox', 10, 270, 1, 0, 99, '1', '1', '0', '0', '', '', '', 'catalog_pet_headline1', 'cow_pet2', 'Wir freuen uns sehr und sind stolz darauf, das neue Kuhhaustier zu präsentieren! Hol dir eine von 16 verschiedenen Rassen aus der Cow Pet Box', '', '');
INSERT INTO `catalog_pages` VALUES (252, 3, 'default_3x3', 'temporary_effects', 'Efectos transitorios', 6, 263, 1, 0, 14, '1', '0', '0', '0', '', '', '', 'avatar_fx_header', 'catalog_teaser_vikings', 'Benötigen Sie einen bestimmten temporären Effekt für einen bestimmten Zweck? Nun, suchen Sie nicht weiter! Hier finden Sie eine begrenzte Auswahl an temporären Spezialeffekten!', '', '');
INSERT INTO `catalog_pages` VALUES (253, 2, 'default_3x3', 'music_shop', 'Música', 1, 4, 1, 0, 15, '1', '1', '0', '0', '', '', '', 'music_header', 'catalog_djshop_teaser1', 'Machen wir uns laut! Stellen Sie eine Jukebox in Ihr Zimmer, fügen Sie ein paar Platten aus der \"Habbo Hotel Hits\" Liste unten hinzu und Sie sind bereit für eine Tanzparty!', '', '');
INSERT INTO `catalog_pages` VALUES (254, 253, 'soundmachine', 'habbo_hotel_hits', 'Hits Habbo Hotel', 1, 257, 1, 0, 2, '1', '1', '0', '0', '', 'Necesitas estar en una habitación para\r\n\"pre-escuchar\" los discos!', '', 'hotelhits_catalog_header', 'hotelhits_teaser', 'Erhöhen Sie die Lautstärke mit ein paar coolen neuen Melodien für Ihr Zimmer. Platzieren Sie eine Jukebox in Ihrem Zimmer, holen Sie sich einige dieser Discs mit Songs und fügen Sie sie zu Ihrer Wiedergabeliste hinzu.', '', '');
