INSERT INTO `catalog_pages` VALUES (272, 209, 'default_3x3', 'urban', 'Urbano', 1, 32, 1, 0, 104, '1', '1', '0', '0', '', '', '', 'urban_header_en', 'urban_teaser_en', 'Die Auswahl an Möbeln im Stil von New York City, Urban ist perfekt für jede Straße, Gasse oder Straße. Mülltonnen, Laternenpfähle und Bänke, alle Stadtmöbel, die Sie brauchen!', '', '');
INSERT INTO `catalog_pages` VALUES (275, 372, 'default_3x3', 'newyear', 'Día de Año Nuevo', 1, 91, 1, 0, 1, '1', '1', '0', '0', '', '', '', 'newyears', 'catal_fp_pic5', 'All diese Jahre sind vergangen, erleben Sie sie mit dieser Furni.', '', '');
INSERT INTO `catalog_pages` VALUES (277, 4, 'pets3', 'pet_animals', 'Animales domésticos', 1, 8, 1, 0, 1, '1', '1', '0', '0', '', '<p><strong>Kaufe dir dein treues Haustier und trainiere es!</strong></p>', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', 'catalog_pet_headline1_en', 'ctlg_pet_note', '', '', '');
INSERT INTO `catalog_pages` VALUES (278, 4, 'default_3x3', 'breeding_boxes', 'Mascota Baby Boxeo', 1, 99, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'babypets_cata_header', 'babypets_teaser', 'Um ein Haustierbaby zu züchten, müssen Sie ein Brutnest kaufen und zwei erwachsene Haustiere des gleichen Typs haben.  Mindestens eines der erwachsenen Haustiere muss in Ihrem Besitz sein. Das Brutnest verschwindet, nachdem die Zucht abgeschlossen ist. Über 20 Rassen jedes Babyhaustieres verfügbar, darunter selten und super selten!', '', '');
INSERT INTO `catalog_pages` VALUES (279, 209, 'default_3x3', 'jet_set', 'Jetset', 1, 237, 1, 0, 61, '1', '1', '0', '0', '', '', '', 'jetset_header', 'jetset_cashcomp2', 'Sind Sie bereit für den Launch der neuen Jet Set Serie? Sind! Machen Sie sich bereit, die Wellen auf Ihrer Yacht oder Ihrem Jetski zu reiten und entspannen Sie einfach in einem tropischen Paradies.', '', '');
INSERT INTO `catalog_pages` VALUES (280, 209, 'default_3x3', 'habbowood', 'HabboWood', 1, 33, 1, 0, 52, '1', '1', '0', '0', '', '', '', 'habbowood', 'habbowood_logo', 'Ob es sich um einen Boulevard der Stars, ein Kino, ein Theater, eine Garderobe oder ein ganzes Filmstudio handelt, das möblierte Habbo Wood erfüllt alle Anforderungen, um die Bühne zu verlassen!', '', '');
INSERT INTO `catalog_pages` VALUES (281, 568, 'default_3x3', 'area', 'Área', 1, 14, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_area_headline1', 'catalog_area_teaser1', 'Eine dicke und raffinierte Linie für die Füße auf dem Boden, ihre Einfachheit ist schön und verleiht jedem Raum einen gemütlichen Charme.', '', '');
INSERT INTO `catalog_pages` VALUES (282, 209, 'default_3x3', 'country', 'Campo', 1, 21, 1, 0, 30, '1', '1', '0', '0', '', '', '', 'country_header1_en_001', 'country_teaser1', '\"Wenn ich aufs Land ziehe, werde ich viele Pfirsiche essen\" ... Die Natur ruft mit der Country Furni Serie!', '', '');
INSERT INTO `catalog_pages` VALUES (299, 445, 'default_3x3', 'valentine_2014', 'Día de San Valentín 2014', 1, 62, 1, 0, 44, '1', '1', '0', '0', '', '', '', 'catalog_header_spa', 'catalog_teaser_spa', 'Manchmal ist alles, was Sie wollen, ein schöner entspannender Spa-Tag. Mit dieser Furni-Linie können Sie einen mit Ihrem Valentinstag genießen!', '', '');
