INSERT INTO `catalog_pages` VALUES (361, 387, 'default_3x3', 'battleball', 'Balón de combate', 1, 927, 1, 0, 15, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'spromo_Blue_BB', 'Das Battleball-Spiel wurde zusammen mit Snowstorm aus Habbo entfernt, da Sulake beschloss, sich mehr auf die Verbesserung anderer Teile des Hotels zu konzentrieren. ', '', '');
