INSERT INTO `catalog_pages` VALUES (11001, 2, 'pets3', 'kbhome', 'Información', 1, 55, 1, 0, 0, '1', '1', '0', '0', 'Willkommen im Habbo-Katalog!', '<p>In diesem Abschnitt von \"Möbel\" findest du klassische Möbel, saisonale Möbel, Bots, Wired und unsere Neuheiten!</p>\r\n<p>Das Habbo-Team ist immer bemüht den Katalog aktuell zu halten.</p>\r\n<p>Solltest du etwas nicht finden, versuche es mit der Suchmaschine! </p>\r\n<p>Solltest du dennoch Hilfe benötigen, wende dich an einen Habbo Mitarbeiter, wir stehen dir immer zur Seite!</p>\r\n<p><strong>- Dein Habbo-Team</strong></p>', '', 'Stars_header', 'catalog_teaser_shop', NULL, NULL, '');
INSERT INTO `catalog_pages` VALUES (11002, 4, 'pets3', 'info_pets', 'Información sobre mascotas', 1, 55, 1, 0, 0, '1', '1', '0', '0', 'Willkommen im Haustier Shop!', '<p>Hier im Haustier Shop kannst du dir verschiedene Haustiere kaufen, dich um sie kümmern und sie pflegen. Wir stellen dir hier eine vielzahl an Haustieren zur Verfügung. Trainiere deine Haustiere, füttere sie und sie werden immer dein treuer Freund sein.</p>\r\n<p><strong>Was bringen Haustier-Level?</strong></p>\r\n<p>Je höher das Level deines Haustiers, desto mehr Skills besitzt es.</p>\r\n<p>Das Habbo-Team arbeitet stetig daran, neue Haustiere in den Haustier Shop einzubringen. Falls du ausgefallene und kreative Wünsche hast, kannst du sie der Projektleitung mitteilen.</p>\r\n<p><strong>- Dein Habbo-Team</strong></p>', '', 'Stars_header', 'catalog_teaser_pets1', NULL, '', '');
INSERT INTO `catalog_pages` VALUES (11003, 5, 'pets3', 'info_baw', 'Construcción Información', 1, 55, 1, 0, 1, '1', '1', '0', '0', 'Offizieller Habbo-Katalog!', '<p>In diesem Abschnitt von \"Bauen\" findest du alle Elemente, die du benötigst, um deinen Raum kreativer zu gestalten, stapelbare Fliesen, Bausteine, öffentliche Möbel usw. Wenn du etwas nicht finden kannst, versuche es mit der Suchmaschine. Wenn du trotzdem nicht findest, was du brauchst, frage einen Xler, sie stehen dir so wie anderen zur Verfügung. Auf der Suche nach Verbesserung ändern wir unseren Katalog ständig mit einem erfahrenen Team, um gemeinsam mit euch unsere Kreationen zu optimieren. Wir sind für euch da, wir sind Habbo!</p>\r\n<p>- <strong>Habbo Hotel letzte aktuallisierung 15.09.2024</strong></p>', '', 'Stars_header', 'catalog_teaser_baw1', NULL, '', '');
INSERT INTO `catalog_pages` VALUES (11004, 7, 'pets3', 'info_staff', 'Información del personal', 8, 933, 1, 0, -1, '1', '1', '0', '0', 'Habbo Staff-Katalog', '<p>Hier befindet sich der Staff-Katalog. Die Gegenstände hier <strong>beeinflussen die wirtschaft im Habbo stark.</strong></p>\r\n<p>Die Gegenstände dürfen als Gewinne für Events verwendet werden, aber keinesfalls verschenkt! </p>\r\n<p>Bitte beachtet, dass sich hier Items teilweise im Test befinden. Ich bitte euch <span style=\"color:#e03e2d;\"><strong>KEINE</strong></span> Items aus dem Tab <span style=\"color:#e03e2d;\"><strong>Mori - Test</strong></span> zu kaufen.</p>\r\n<p><span style=\"color:#e03e2d;\"><strong>Wer sich nicht an die Regeln halten kann, wird ohne Warnung aus dem Team ausgeschlossen.</strong></span></p>', '', 'Stars_header', 'catalog_teaser_staff', NULL, '', '');
INSERT INTO `catalog_pages` VALUES (11005, 700, 'pets3', 'info_vip', 'Información VIP', 1, 55, 1, 0, 1, '1', '1', '0', '0', 'VIP Katalog im Habbo Hotel', '<p>In diesem VIP-Bereich kannst du einen speziellen Pass kaufen, wie im VIP-Bereich angegeben, mit dem du spezielle Kleidung erhaltest, mehr Diamanten und Duckets für Aktivität im Habbo Hotel, ein Badge, das dich als VIP-Benutzer ausweist, und vieles vieles mehr . Über unsere Homepage kannst du dir dein VIP mit einer Paysafecard kaufen. Wenn du etwas nicht finden konntest, versuche es mit der Suchmaschine. Wenn du trotzdem nicht findest, was du brauchst, dann frage einen Xler um Hilfe, sie stehen dir zur Verfügung. Auf der Suche nach Verbesserung ändern wir unseren Katalog ständig mit einem erfahrenen Team, um gemeinsam mit euch unsere Kreationen zu optimieren. Wir sind für euch da, wir sind Habbo! - <strong>Dein HabboJE Team</strong></p>', '', 'Stars_header', 'catalog_teaser_vip', NULL, '', '');
INSERT INTO `catalog_pages` VALUES (11006, 1411, 'pets3', 'info_comercio', 'Información comercial', 1, 55, 1, 0, 0, '1', '1', '0', '0', 'Habbo Besonderheiten', '<p>In diesem Abschnitt von \"Besonderheiten\" findest du Rares, Badges, Taler, Diamanten, Kubbitos und andere Besonderheiten!</p>\r\n<p>Die am häufigsten verwendete Währung sind Diamanten, obwohl unsere offizielle und exklusive Währung Kubbitos sind.</p>\r\n<p>Du kannst Diamanten, Herzen und Taler erhalten indem du an unseren Events teilnimmst. </p>\r\n<p>Solltest du weitere Fragen haben, melde dich bei einem Habbo Mitarbeiter.  Wir sind immer bemüht dir zu helfen!</p>\r\n<p><strong>- Dein Habbo-Team</strong></p>', '', 'Stars_header', 'catalog_teaser_shop', NULL, '', '');
